-- ----------------------------
-- Table structure for game_record
-- ----------------------------
DROP TABLE IF EXISTS `game_record`;
CREATE TABLE `game_record`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `start_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '开始时间',
  `end_time` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '结束时间',
  `user_1_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '玩家1',
  `user_2_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '玩家2',
  `user_3_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '玩家3',
  `room_owner_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '房主id',
  `landlord_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '地主id',
  `user_1_get_ingots` int(11) NOT NULL COMMENT '玩家1获得元宝（可以是负数）',
  `user_2_get_ingots` int(11) NOT NULL COMMENT '玩家2获得元宝（可以是负数）',
  `user_3_get_ingots` int(11) NOT NULL COMMENT '玩家3获得元宝（可以是负数）',
  `user_1_redouble` int(11) NULL DEFAULT NULL COMMENT '玩家1是否加倍，1不加倍 2加倍 3超级加倍',
  `user_2_redouble` int(11) NULL DEFAULT NULL COMMENT '玩家2是否加倍，1不加倍 2加倍 3超级加倍',
  `user_3_redouble` int(11) NULL DEFAULT NULL COMMENT '玩家3是否加倍，1不加倍 2加倍 3超级加倍',
  `user_1_mingpai` int(11) NOT NULL COMMENT '玩家1是否名牌，0不明排 1 明牌',
  `user_2_mingpai` int(11) NOT NULL COMMENT '玩家2是否名牌，0不明排 1 明牌',
  `user_3_mingpai` int(11) NOT NULL COMMENT '玩家3是否名牌，0不明排 1 明牌',
  `room_rate` int(255) NOT NULL COMMENT '最终倍率',
  `level` int(11) NOT NULL COMMENT '等级 1：初级 2：中级 3：高级 4：大师',
  `room_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '房间id',
  `victory_user_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '胜利玩家id，字符串数组，农民胜利是多个玩家id',
  `play_card_record` longtext CHARACTER SET sjis COLLATE sjis_japanese_ci NOT NULL COMMENT '玩家出牌记录，字符串JSON格式存储',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 174 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

