-- ----------------------------
-- Table structure for user
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user`  (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `user_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `user_account` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '微信授权的用户，账号为openid',
  `user_password` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `user_head_img` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `wx_openid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '微信用户登录，没有openid为游客登录',
  `gold` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '1000' COMMENT '游戏元宝',
  `game_audio` int(11) NOT NULL DEFAULT 1 COMMENT '1 开启音乐 0 关闭音乐（默认1）',
  `bg_audio` int(11) NOT NULL DEFAULT 1 COMMENT '1 开启音乐 0 关闭音乐（默认1）',
  `day_get_gold` timestamp NULL DEFAULT NULL COMMENT '每日登录领取1000元宝（领取过存入当前日期）',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 10007 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;

